INSERT INTO `case_imp` VALUES ('1', '贫血', null, 'admin', '2021-06-01 14:18:28', 'admin', null);
INSERT INTO `case_imp` VALUES ('2', '轻度焦虑', '1.忧虑：对未发生的事情感到过度的担忧、紧张，做事时注意力难以集中，易激惹等\n2.运动性紧张：肌肉容易出现疲劳，坐卧不安，紧张性头痛、颤抖、无法放松等\n3.其他高警觉症状：出汗、口干、心跳加快、呼吸困难、头晕等\n4.症状持续6个月以上', 'admin', '2021-06-01 14:26:36', 'admin', '2021-06-07 09:38:48');
INSERT INTO `case_imp` VALUES ('3', '轻度抑郁', '核心症状：\nA.心境低落\nB.兴趣与愉快感丧失\nC.易疲劳\n附加症状：\n1.集中注意和注意的能力降低\n2.自我评价和自信降低\n3.自罪观念和无价值感\n4.认为前途黯淡悲观\n5.自伤或自杀的观念或行为\n6.睡眠障碍\n7.食欲减退或增加', 'admin', '2021-06-01 14:26:47', 'admin', '2021-06-07 09:35:28');
INSERT INTO `case_imp` VALUES ('4', '继发性不宁腿综合症', 'A.有活动下肢的强烈意愿，通常伴随下肢令人不适、不愉快感觉，或是对这种不适感觉的反应，且活动下肢意愿的特点是，在休息或静止时开始或者加重，在活动后部分或完全解除，傍晚或夜间重于白天或者只在傍晚或夜间出现\nB.A条描述的症状每周至少发生3次，持续至少3个月\nC.症状导致明显痛苦或社交、职业、教育、学业、行为或其他重要功能的损害\nD. 症状不是由另一种精神障碍或躯体疾病（如关节炎、下肢水肿、外周性局部缺血、下肢痉挛等）导致，也不能用某种行为问题（如姿位性不适、习惯性抖脚等）来更好地解释\nE.症状不是由某种药物滥用或治疗（如静坐不能)所导致的', 'admin', '2021-06-01 14:27:16', 'admin', '2021-06-07 09:45:55');
INSERT INTO `case_imp` VALUES ('5', '重度阻塞性睡眠呼吸暂停综合症', '同时满足以下A和B，或者满足C：\nA.出现以下一条或多条：\n1.	患者抱怨日间嗜睡、无恢复性睡眠、疲劳或失眠。\n2.	患者由于呼吸暂停、窒息或者喘息而醒来。\n3.	床伴或者其他人报告患者睡眠时有习惯性打鼾、呼吸中断或两症状同时存在。\n4.	患者已被诊断为高血压、情感障碍、认知障碍、冠心病、卒中、充血性心力衰竭、房颤或者2型糖尿病。\nB.PSG结果显示：每小时出现5次或者以上明显的阻塞性睡眠呼吸事件\n或者\nC.PSG结果显示：每小时出现15次或者以上明显的阻塞性睡眠呼吸事件。', 'admin', '2021-06-01 14:28:14', 'admin', '2021-06-01 14:38:19');
INSERT INTO `case_imp` VALUES ('6', '情绪障碍引起的失眠', '失眠只要是由情绪造成的', 'admin', '2021-06-01 14:28:25', 'admin', '2021-06-07 09:46:20');
INSERT INTO `case_imp` VALUES ('7', '躯体疾病所致失眠', '失眠只要是由躯体疾病造成的', 'admin', '2021-06-01 14:29:04', 'admin', '2021-06-07 09:46:28');
INSERT INTO `case_imp` VALUES ('8', '发作性睡病', 'A.患者每天均出现难以抑制的嗜睡，持续时间至少3个月\nB.具有下列1或2项表现\n1）发作性猝倒和MSLT显示平均睡眠潜伏时间≤8分钟，出现两次或两次以上的SOREMPs。睡眠起始15分钟内出现的快动眼睡眠可替代MSLT中的一次SOREMP。\n2）免疫法测定CSF下丘脑分泌素-1浓度≤110pg/ml，或小于以同一标准检验正常者平均值的1/3打鼾', 'admin', '2021-06-01 14:29:29', 'admin', '2021-06-07 09:47:20');
INSERT INTO `case_imp` VALUES ('9', '单纯性打鼾', '一周至少有五天出现睡眠时打鼾', 'admin', '2021-06-01 14:29:50', 'admin', '2021-06-07 09:46:40');
INSERT INTO `case_imp` VALUES ('10', '中度焦虑', '1.忧虑：对未发生的事情感到过度的担忧、紧张，做事时注意力难以集中，易激惹等\n2.运动性紧张：肌肉容易出现疲劳，坐卧不安，紧张性头痛、颤抖、无法放松等\n3.其他高警觉症状：出汗、口干、心跳加快、呼吸困难、头晕等\n4.症状持续6个月以上', 'admin', '2021-06-07 09:32:42', 'admin', '2021-06-07 09:38:40');
