INSERT INTO `case_imp` VALUES ('12', '中度抑郁', '核心症状：\nA.心境低落\nB.兴趣与愉快感丧失\nC.易疲劳\n附加症状：\n1.集中注意和注意的能力降低\n2.自我评价和自信降低\n3.自罪观念和无价值感\n4.认为前途黯淡悲观\n5.自伤或自杀的观念或行为\n6.睡眠障碍\n7.食欲减退或增加', 'admin', '2021-06-07 09:35:14', 'admin', null);
