INSERT INTO `case_imp_diagnosis` VALUES ('29', '7.食欲减退或增加', '22', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('30', 'A.有活动下肢的强烈意愿，通常伴随下肢令人不适、不愉快感觉，或是对这种不适感觉的反应，且活动下肢意愿的特点是，在休息或静止时开始或者加重，在活动后部分或完全解除，傍晚或夜间重于白天或者只在傍晚或夜间出现', '4', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('31', 'B.A条描述的症状每周至少发生3次，持续至少3个月', '4', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('32', 'C.症状导致明显痛苦或社交、职业、教育、学业、行为或其他重要功能的损害', '4', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('33', 'D. 症状不是由另一种精神障碍或躯体疾病（如关节炎、下肢水肿、外周性局部缺血、下肢痉挛等）导致，也不能用某种行为问题（如姿位性不适、习惯性抖脚等）来更好地解释', '4', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('34', 'E.症状不是由某种药物滥用或治疗（如静坐不能)所导致的', '4', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('35', 'A.出现以下一条或多条', '5', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('36', '1.患者抱怨日间嗜睡、无恢复性睡眠、疲劳或失眠', '35', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('37', '2.患者由于呼吸暂停、窒息或者喘息而醒来', '35', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('38', '3.床伴或者其他人报告患者睡眠时有习惯性打鼾、呼吸中断或两症状同时存在', '35', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('39', '4.患者已被诊断为高血压、情感障碍、认知障碍、冠心病、卒中、充血性心力衰竭、房颤或者2型糖尿病。', '35', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('40', 'B.PSG结果显示：每小时出现5次或者以上明显的阻塞性睡眠呼吸事件', '5', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('41', 'C.PSG结果显示：每小时出现15次或者以上明显的阻塞性睡眠呼吸事件', '5', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('42', '失眠只要是由情绪造成的', '6', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('43', '失眠只要是由躯体疾病造成的', '7', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('44', 'A.患者每天均出现难以抑制的嗜睡，持续时间至少3个月', '8', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('45', 'B.具有下列1或2项表现', '8', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('46', '1）发作性猝倒和MSLT显示平均睡眠潜伏时间≤8分钟，出现两次或两次以上的SOREMPs。睡眠起始15分钟内出现的快动眼睡眠可替代MSLT中的一次SOREMP。', '45', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('47', '2）免疫法测定CSF下丘脑分泌素-1浓度≤110pg/ml，或小于以同一标准检验正常者平均值的1/3打鼾', '45', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('48', '一周至少有五天出现睡眠时打鼾', '9', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('49', '1.忧虑：对未发生的事情感到过度的担忧、紧张，做事时注意力难以集中，易激惹等', '10', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('50', '2.运动性紧张：肌肉容易出现疲劳，坐卧不安，紧张性头痛、颤抖、无法放松等', '10', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('51', '3.其他高警觉症状：出汗、口干、心跳加快、呼吸困难、头晕等', '10', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
INSERT INTO `case_imp_diagnosis` VALUES ('52', '4.症状持续6个月以上', '10', 'admin', '2021-08-12 13:59:06', 'admin', '2021-08-12 13:59:11');
