INSERT INTO `case_question` VALUES ('4', '1', '睡眠不好多久了？加重多长时间了？', '睡眠不好有好几年了，大概有6~7年，最近半个月加重了。', '7', '睡眠不好约6~7年，近半月加重', null, null, null, null);
INSERT INTO `case_question` VALUES ('5', '1', '之前睡眠不好有原因吗？最近加重有原因吗？', '嗯，之前似乎没啥特殊的，家里工作上鸡毛蒜皮的小事，最近半个月有点\r\n事闹了不愉快，整夜都睡不着。', '8', '无明显诱因', null, null, null, null);
INSERT INTO `case_question` VALUES ('6', '1', '一般入睡需要多长时间？', '需要2~3小时才能睡着，最近不吃药就整夜睡不着。', '6', '入睡困难、睡眠轻浅，白天嗜睡', null, null, null, null);
INSERT INTO `case_question` VALUES ('7', '1', '晚上能睡多长时间？', '之前我感觉我能睡3~4小时，最近吃药也就3~4小时，但是家人说我睡6~7小时，睡的挺深的，还打呼噜，我不觉得我打呼噜。最近一夜都合不上眼睛。', '6', '入睡困难、睡眠轻浅，白天嗜睡', null, null, null, null);
INSERT INTO `case_question` VALUES ('8', '1', '睡眠质量怎么样？', '不好，似睡非睡的，睡一会就醒了，半夜醒好几回，还做梦，一睡着就做梦，有时候感觉憋气，有时候一下就憋醒了。', '6', '入睡困难、睡眠轻浅，白天嗜睡', null, null, null, null);
INSERT INTO `case_question` VALUES ('9', '1', '醒来能再睡着么？', '大多数时候不好睡，要等1~2小时才能迷糊一会，一会又醒了。', '6', '入睡困难、睡眠轻浅，白天嗜睡', null, null, null, null);
INSERT INTO `case_question` VALUES ('10', '1', '睡不着的时候您做什么？', '睡不着躺在床上翻来覆去，越躺越烦躁，翻来覆去。', '6', '入睡困难、睡眠轻浅，白天嗜睡', null, null, null, null);
INSERT INTO `case_question` VALUES ('11', '1', '晚上睡不好第二天精神怎么样？', '第二天精神差，困倦、疲乏，心情也不太好，家务也懒得做。', '9', '睡不好影响次日身心状态', null, null, null, null);
INSERT INTO `case_question` VALUES ('12', '1', '白天困倦会睡着么？', '会打盹，坐着看电视啥的就睡着了，一天能打盹好几次。但躺在床上睡不着。 ', '6', '入睡困难、睡眠轻浅，白天嗜睡', null, null, null, null);
INSERT INTO `case_question` VALUES ('13', '1', '睡前有没有身体别的不舒服影响您入睡？', '有有有，左腿常常不舒服，有时候像虫子爬，有时候烧的，反正是怎么放都不舒服，需要捏一捏，捶一锤、活动活动或下地走走可以减轻。', '11', '左腿不适，需不断活动肢体才可缓解', null, null, null, null);
INSERT INTO `case_question` VALUES ('14', '1', '平时情绪怎么样？心情好不好？', '睡不着第二天就会心烦，不开心，睡好了，心情就还好。', '38', '感到心烦、心情不好', null, null, null, null);
INSERT INTO `case_question` VALUES ('15', '1', '平时有没有容易紧张、担心、烦躁？', '有点紧张和担心，尤其是睡不着就胡思乱想，想我是不是得什么病了。', '39', '有点紧张和担心', null, null, null, null);
INSERT INTO `case_question` VALUES ('16', '1', '身体上有没有别的不舒服？', '有点头晕，有时候有耳鸣、看东西模糊，其他没有。', '12', '有点头晕，有时耳鸣、看东西模糊', null, null, null, null);
INSERT INTO `case_question` VALUES ('17', '1', '注意力怎么样？平时看电视、看书会不会走神？', '注意力没以前集中了，看到喜欢的电视剧也看不进去。', '13', '下降', null, null, null, null);
INSERT INTO `case_question` VALUES ('18', '1', '记忆力怎么样？', '记忆力比以前差多了，常常丢三落四。', '14', '下降，常丢三落四', null, null, null, null);
INSERT INTO `case_question` VALUES ('19', '1', '我给您出一道计算题？100-7=？依次减7减五次分别等于多少？', '93、86、79、72、65。', '15', '正常', null, null, null, null);
INSERT INTO `case_question` VALUES ('20', '1', '有没有用药治疗过？', '用过药，用过佐匹克隆、右佐匹克隆、艾司唑仑都效果不太好，现在一天\r\n服3~4片阿普唑仑，还是感觉效果不好。', '16', '服药佐匹克隆、右佐匹克隆、\r\n艾司唑仑、阿普唑仑，效果不好', null, null, null, null);
INSERT INTO `case_question` VALUES ('21', '1', '该状况对您生活造成影响了吗？', '有影响，我白天的工作和生活总体状态不是太好。', '10', '影响白天工作和生活', null, null, null, null);
INSERT INTO `case_question` VALUES ('22', '1', '食欲怎么样？体重有没有变化？', '最近食欲不好，体重没什么变化。', '18', '食欲不好，体重无变化', null, null, null, null);
INSERT INTO `case_question` VALUES ('23', '1', '大小便怎么样？', '有点便秘。', '19', '有点便秘', null, null, null, null);
INSERT INTO `case_question` VALUES ('24', '1', '以前有没有类似症状发生？', '没有，就最近几年睡眠不好，以前都挺好的。', '17', '之前无类似症状', null, null, null, null);
INSERT INTO `case_question` VALUES ('25', '1', '您有觉得走在路上人们在谈论您或特别注意您吗? ', '没有这种现象', '20', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('26', '1', '您有没有从电视、收音机、报纸或其它您周围的途径得到特殊的信息?', '没有', '20', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('27', '1', '您是否曾感觉到其他人或外界的东西在控制您的思想和行为，违背了您的意愿?（时间是否持续一个月？）', '没有，我只是睡眠不好', '21', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('28', '1', '您是否曾觉得您的思想被大声地广播出去，以致其他人能真切地听到您的想法?（时间是否持续一个月？）', '没有没有', '22', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('29', '1', '您是否曾听到别人听不到的声音，譬如噪音、人们的耳语或谈话的声音?（那时您是觉醒的吗?）（时间是否持续一个月？）', '没有', '23', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('30', '1', '有没有人故意为难您或想要伤害您？', '没有', '24', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('31', '1', '您是否曾有一段时间感觉很愉快、情绪高涨、激动，以致使别人认为您与平时不一样或使您遇到麻烦？', '没有过，睡不着怎么会有精力呢，白天什么都不想做。', '25', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('32', '1', '您是否有睡眠需要量减少（如感到只需三小时睡眠便休息好了）？', '没有，我睡眠不好的时候没精神。', '25', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('33', '1', '是否有些您必须一次又一次地重复做并且不能抵制不做的事，如反复洗手、\r\n数数或多次检查某些事以证实自己做对了等。', '这个没有', '26', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('34', '1', '您有没有高血压、糖尿病或脑梗、脑出血病史？', '有高血压，现在服用左旋氨氯地平片，控制的还可以。', '27', '高血压，服用左\r\n旋氨氯地平片，血压控制良好', null, null, null, null);
INSERT INTO `case_question` VALUES ('35', '1', '您是否受过外伤或之前做过什么手术？', '小时候做过阑尾切除术。', '28', '阑尾切除术', null, null, null, null);
INSERT INTO `case_question` VALUES ('36', '1', '有无对食物、药物过敏的？', '没有', '29', '无过敏史', null, null, null, null);
INSERT INTO `case_question` VALUES ('37', '1', '您觉得您是一个什么性格的人？', '我性格比较内向。', '30', '比较内向', null, null, null, null);
INSERT INTO `case_question` VALUES ('38', '1', '您平时有什么兴趣爱好？', '平时兴趣爱好比较少。', '31', '较少', null, null, null, null);
INSERT INTO `case_question` VALUES ('39', '1', '您和周围同事关系怎么样？', '和周围同事关系挺好的。最近也没精力出去，不想出门。', '32', '和周围同事关系和睦', null, null, null, null);
INSERT INTO `case_question` VALUES ('40', '1', '您什么时候开始工作的？', '我25岁开始工作。', '33', '25岁开始工作', null, null, null, null);
INSERT INTO `case_question` VALUES ('41', '1', '您有几个兄弟姐妹，您排行老几？', '家中兄妹3人，我排行老二，有个姐姐，一个弟弟', '34', '兄妹3人，排行老二', null, null, null, null);
INSERT INTO `case_question` VALUES ('42', '1', '您有宗教信仰吗？', '没有', '35', '无', null, null, null, null);
INSERT INTO `case_question` VALUES ('43', '1', '您月经初潮多少岁？月经周期是多少天？一般持续几天？是否停经，睡不着觉与经期有无相关联性？', '我14岁第一次来月经，比较规律，周期大约1个月，一般持续5天左右。我2年前停经的。睡眠和经期没有什么关系。', '36', '月经初潮14岁，经期较规律，2年前停经。', null, null, 'admin', null);
INSERT INTO `case_question` VALUES ('44', '1', '您抽烟、喝酒吗？', '不抽烟，喝酒是应酬的时候会少喝。', '37', '不抽烟、少喝酒', null, null, null, null);
INSERT INTO `case_question` VALUES ('45', '1', '您家里父母两边的亲戚是否有患过精神疾病？', '没有', '5', '无', null, null, null, null);
