INSERT INTO `sys_oper_log` VALUES ('1047', '问诊问答', '2', 'com.qx.web.controller.cases.SysCaseQuestionController.edit()', 'PUT', '1', 'admin', null, '/cases/question', '127.0.0.1', '内网IP', '{\"question\":\"您月经初潮多少岁？月经周期是多少天？一般持续几天？是否停经，睡不着觉与经期有无相关联性？\",\"patientId\":1,\"params\":{},\"type\":{\"typeName\":\"月经\",\"pid\":4,\"params\":{},\"children\":[],\"id\":43},\"result\":\"月经初潮14岁，经期较规律，2年前停经。\",\"answer\":\"我14岁第一次来月经，比较规律，周期大约1个月，一般持续5天左右。我2年前停经的。睡眠和经期没有什么关系。\",\"updateBy\":\"admin\",\"typeId\":36,\"id\":43}', '{\"msg\":\"操作成功\",\"code\":200}', '0', null, '2021-06-07 09:30:53');
